import React from "react";

const Testimonial = () => {
  return (
    <>
      <section className="Testimonial_section">
        <div className="container">
          <h1>Customer Reviews</h1>
          <div className="row my-5">
            <div className="col-md-10 col-12 mx-auto">
              <h1>dewedu</h1>
          </div>
        </div>
        </div>
      </section>
    </>
  );
};

export default Testimonial;
